// src/components/Navbar.js
import React from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";

const Nav = styled.nav`
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 0 84px;
  height: 100px;
  width: 100%;
  background-color: #ffffff;
  box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
  box-sizing: border-box;

  @media (max-width: 768px) {
    padding: 0 20px;
  }
`;

const LogoSection = styled.div`
  display: flex;
  align-items: center;
`;

const Logo = styled.img`
  height: 40px;
  margin-right: 10px;
`;

const CompanyName = styled.span`
  color: #000;
  font-family: Pretendard;
  font-size: 20px;
  font-style: normal;
  font-weight: 700;
  line-height: normal;
`;

const Menu = styled.div`
  display: flex;
  gap: 24px;
`;

const MenuItem = styled(Link)`
  font-size: 1rem;
  text-decoration: none;
  color: #333333;
  padding: 8px 0;
  transition: color 0.3s ease;

  &:hover {
    color: #007bff;
  }
`;

const SupportButton = styled(Link)`
  padding: 10px 20px;
  background-color: #ff5722;
  color: #ffffff;
  font-size: 1rem;
  text-decoration: none;
  border-radius: 4px;
  transition: background-color 0.3s ease;

  &:hover {
    background-color: #e64a19;
  }
`;

const Navbar = () => {
  return (
    <Nav>
      <LogoSection>
        <Logo src="/images/logo.png" alt="Company Logo" />
        <CompanyName>ONGDALSAM</CompanyName>
      </LogoSection>
      <Menu>
        <MenuItem to="/about">소개</MenuItem>
        <MenuItem to="/activities">활동</MenuItem>
        <MenuItem to="/story">스토리</MenuItem>
        <MenuItem to="/technology">기술</MenuItem>
        <MenuItem to="/team">구성원</MenuItem>
      </Menu>
      <SupportButton to="/support">후원하기</SupportButton>
    </Nav>
  );
};

export default Navbar;
